INSERT INTO `cms_block` VALUES (1,'Pixtron Home Blogs','Pixtron-home-blogs','','2017-12-05 06:53:32','2017-12-05 07:27:53',1),(2,'Pixtron Home Brands','pixtron-home-brands','','2017-12-05 06:53:32','2017-12-05 07:27:22',1),(3,'Pixtron Home Images Block','pixtron-home-images-one','','2017-12-05 06:53:32','2017-12-05 07:26:13',1),(4,'Pixtron Home Images Block','pixtron-home-images-two','<div class=\"home-parallax-block above-margin below-margin\">\n<h1>Welcome to our Website</h1>\n</div>','2017-12-05 06:53:32','2017-12-05 07:24:00',1),(5,'Pixtron Home Images Block','pixtron-home-images-three','','2017-12-05 06:53:32','2017-12-05 07:17:45',1),(6,'Pixtron Home Services Block','pixtron-home-services','<div class=\"home-advantage-block\">\r\n    <div class=\"page-main\">\r\n        <div class=\"hab-row\">\r\n            <div class=\"hab-inner\">\r\n                <div class=\"home-advantage-block-inner\">\r\n                    <span>\r\n                        <em class=\"fa fa-usd\"></em>\r\n                    </span>\r\n                    <p>30-Day Money Back</p>\r\n                </div>\r\n            </div>\r\n            <div class=\"hab-inner\">\r\n                <div class=\"home-advantage-block-inner\">\r\n                    <span>\r\n                        <em class=\"fa fa-headphones\"></em>\r\n                    </span>\r\n                    <p>1 year Free Support</p>\r\n                </div>\r\n            </div>\r\n            <div class=\"hab-inner\">\r\n                <div class=\"home-advantage-block-inner\">\r\n                    <span>\r\n                        <em class=\"fa fa-undo\"></em>\r\n                    </span>\r\n                    <p>Free Lifetime Update</p>\r\n                </div>\r\n            </div>\r\n            <div class=\"hab-inner\">\r\n                <div class=\"home-advantage-block-inner\">\r\n                    <span>\r\n                        <em class=\"fa fa-thumbs-up\"></em>\r\n                    </span>\r\n                    <p>100% Satisfaction</p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(7,'Pixtron Home Slider','pixtron-home-slider','<div class=\"home-slider-wrapper\">\n<div class=\"home-slider-main\">\n<ul class=\"home-slider\">\n<li><a href=\"#\"> <img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/slider/home-banner.jpg\"}}\" alt=\"home banner\" /> </a></li>\n<li style=\"display: none;\"><a href=\"#\"> <img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/slider/home-banner1.jpg\"}}\" alt=\"home banner\" /> </a></li>\n</ul>\n</div>\n<script type=\"text/javascript\" xml=\"space\">\n        require([\'jquery\', \'pixtronowlcarousel\'], function() {\n            jQuery(document).ready(function() {\n                jQuery(\".home-slider\").owlCarousel({\n                    items: 1,\n                    itemsDesktop: [1198, 1],\n                    itemsDesktopSmall: [1023, 1],\n                    itemsTablet: [768, 1],\n                    itemsTabletSmall: [767, 1],\n                    itemsMobile: [479, 1],\n                    pagination: true,\n                    navigationText: [\"<div class=\'left-arrow\'><i class=\'fa fa-angle-left\'></i></div>\", \"<div class=\'right-arrow\'><i class=\'fa fa-angle-right\'></div>\"],\n                    navigation: true,\n                });\n                jQuery(\".home-slider li\").show();\n            });\n        });\n    \n</script>\n</div>','2017-12-05 06:53:32','2017-12-05 07:14:45',1),(8,'Pixtron Payments Icons','pixtron-payment-icons','<span class=\"payment-icons\">\r\n    <ul>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/americanexpress.jpg\"}}\" alt=\"americanexpress\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/discover.jpg\"}}\" alt=\"discover\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/maestro.jpg\"}}\" alt=\"maestro\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/master.jpg\"}}\" alt=\"master\" /></a></li>\r\n        <li><a href=\"#\"><img class=\"image-responsive middle-block\" src=\"{{media url=\"wysiwyg/paymet/visa.jpg\"}}\" alt=\"visa\" /></a></li>\r\n    </ul>\r\n</span>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(9,'Pixtron Footer Payment & My Account','pixtron-footer-payment-shipping','<ul class=\"footer links\">\r\n<li class=\"nav item\"><a href=\"#\">Terms of Use</a></li>\r\n<li class=\"nav item\"><a href=\"#\">Payment Methods</a></li>\r\n<li class=\"nav item\"><a href=\"#\">Shipping Guide</a></li>\r\n<li class=\"nav item\"><a href=\"#\">Order Tracking</a></li>\r\n<li class=\"nav item\"><a href=\"#\">Return % Exchange</a></li>\r\n</ul>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(10,'Pixtron Footer My Account Block','pixtron-footer-myaccount','<ul class=\"footer links\">\r\n<li class=\"nav item\"><a href=\"#\">My Account</a></li>\r\n<li class=\"nav item\"><a href=\"#\">Login</a></li>\r\n<li class=\"nav item\"><a href=\"#\">My Cart</a></li>\r\n<li class=\"nav item\"><a href=\"#\">My Compare</a></li>\r\n<li class=\"nav item\"><a href=\"#\">My Wishlist</a></li>\r\n</ul>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(11,'Pixtron Footer Socials Block','pixtron-footer-socials','<div class=\"socials-block\">\r\n            <a href=\"#\"><em class=\"fa fa-facebook\"></em></a>\r\n            <a href=\"#\"><em class=\"fa fa-twitter\"></em></a>\r\n            <a href=\"#\"><em class=\"fa fa-linkedin\"></em></a>\r\n            <a href=\"#\"><em class=\"fa fa-vimeo\"></em></a>\r\n            <a href=\"#\"><em class=\"fa fa-google\"></em></a>\r\n        </div>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(12,'Pixtron Above','pixtron-above','<div class=\"page-main\">\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-slider\"}}\r\n</div>','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(13,'Pixtron Below','pixtron-below','{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-images-three\"}}\r\n<div class=\"page-main\">\r\n{{widget type=\"Magento\\Catalog\\Block\\Product\\Widget\\NewWidget\" display_type=\"all_products\" products_count=\"10\" template=\"product/widget/new/content/new_grid.phtml\"}}\r\n</div>\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-images-two\"}}\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-images-one\"}}\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"home-extension-slider\"}}\r\n<div class=\"page-main\">\r\n{{widget type=\"Magento\\CatalogWidget\\Block\\Product\\ProductsList\" title=\"Featured Products\" products_count=\"5\" template=\"product/widget/content/grid.phtml\" conditions_encoded=\"a:2:[i:1;a:4:[s:4:`type`;s:50:`Magento|CatalogWidget|Model|Rule|Condition|Combine`;s:10:`aggregator`;s:3:`all`;s:5:`value`;s:1:`1`;s:9:`new_child`;s:0:``;]s:4:`1--1`;a:4:[s:4:`type`;s:50:`Magento|CatalogWidget|Model|Rule|Condition|Product`;s:9:`attribute`;s:11:`is_featured`;s:8:`operator`;s:2:`==`;s:5:`value`;s:1:`1`;]]\"}}\r\n</div>\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-testimonials\"}}\r\n{{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"Pixtron-home-blogs\"}} {{widget type=\"Magento\\Cms\\Block\\Widget\\Block\" template=\"widget/static_block/default.phtml\" block_id=\"pixtron-home-brands\"}}','2017-12-05 06:53:32','2017-12-05 06:53:32',1),(14,'Home Extension Slider','home-extension-slider','<div class=\"home-fullwidth-block above-margin below-margin\">\r\n    <div class=\"page-main\">\r\n        <h1>Find Your Next Magento 2 Extension</h1>\r\n        <ul class=\"extension-slider\" style=\"list-style: none; padding: 0; margin: 0;\">\r\n            <li>\r\n                <h1>Most Viewed Products Widget</h1>\r\n                <p>This Magento 2 extension will display the most viewed products on your website to make it easy for your customer in selecting the best products.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/most-viewed-products-widget.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n            <li style=\"display: none;\">\r\n                <h1>Repeat Customer Notifications</h1>\r\n                <p>This Magento 2 extension will help you to start getting notifications regarding your repeat customers. Treat them better every time when they purchase any product from your store.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/repeat-customer-notifications.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n            <li style=\"display: none;\">\r\n                <h1>Index Management</h1>\r\n                <p>This Magento 2 extension will help you to process index management from backend panel. It will automatically update or re-index if any data changes.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/index-management.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n            <li style=\"display: none;\">\r\n                <h1>New Order Notification</h1>\r\n                <p>This Magento 2 extension helps admin to start getting notifications regarding new order. It will save your time through emails to check new orders without logging in to your site.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/new-order-notification.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n            <li style=\"display: none;\">\r\n                <h1>Bestsellers Product Widget</h1>\r\n                <p>This Magento 2 extension will replace the default Magento search functionality with custom search engine powered by Google.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/google-cse-integration.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n            <li style=\"display: none;\">\r\n                <h1>Bestsellers Product Widget</h1>\r\n                <p>This Magento 2 extension will provide the ideal option for placing best selling products anywhere on your store.</p>\r\n                <a class=\"action primary\" href=\"http://www.hiddentechies.com/bestsellers-product-widget.html\" target=\"_blank\">Download Now</a>\r\n            </li>\r\n        </ul>\r\n        <script type=\"text/javascript\" xml=\"space\">\r\n            require([\'jquery\', \'pixtronowlcarousel\'], function() {\r\n                jQuery(document).ready(function() {\r\n                    jQuery(\".extension-slider\").owlCarousel({\r\n                        items: 1,\r\n                        itemsDesktop: [1198, 1],\r\n                        itemsDesktopSmall: [1023, 1],\r\n                        itemsTablet: [768, 1],\r\n                        itemsTabletSmall: [767, 1],\r\n                        itemsMobile: [479, 1],\r\n                        pagination: false,\r\n                        navigation: false,\r\n                        autoPlay: true,\r\n                    });\r\n                    jQuery(\".extension-slider li\").show();\r\n                });\r\n            });\r\n        </script>\r\n    </div>\r\n</div>','2017-12-05 06:53:32','2017-12-05 06:53:32',1);
